(25, 39, 'simple', 'NULL', 23, 'Silver', 77, 'Apple', 'NULL', 'NULL', '1299.99', 'NULL', 'NULL', 'NULL', '2007-08-24 19:28:50', 'NULL', 'NULL', '', 'This, combined with myriad other engineering leaps, boosts performance up to four times higher than the PowerBook G4. With this awesome power, it''s a breeze to render complex 3D models, enjoy smooth playback of HD video, or host a four-way video conference.Intel Core Duo is the first chip built using Intel''s groundbreaking 65-nanometer process - resulting in transistors so small, you could fit a hundred inside a single human cell. With smaller distances for electrons to travel, and two processors designed to share resources and conserve power, Intel Core Duo achieves higher levels of performance as it uses fewer watts. Which is what makes it possible to design a super-powerful MacBook Pro that''s only one inch thin.When Mac technology makes something easy, it''s hardly news. So here''s more non-news for MacBook Pro owners: software just works. If you see the Universal logo on a new application, that means it will run on Intel- and PowerPC-based Mac computers. For most existing applications, you simply do what you''ve always done: double-click them. Thanks to the Rosetta technology in Mac OS X, they look and feel just like they did before.', '19.5 x 7.6 x 19.5 inches', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 0, 'NULL', '100 GB 5400 rpm Serial ATA hard drive', 1, '/a/p/apple-macbook-pro-ma464ll-a-15-4-notebook-pc.jpg', 'NULL', ' <ul>\n\n<ul class="disc">\n\n<li>2.0 GHz Intel Core Duo processor with 2 MB shared L2 Cache<br></li>\n\n<li>1 GB (single SODIMM) 667 MHz DDR2 SDRAM (PC2-5300); 100 GB 5400 rpm Serial ATA hard drive; slot-load SuperDrive (DVDÂ±RW/CD-RW)<br></li>\n\n<li>One FireWire 400, two USB 2.0 ports, and ExpressCard/34 slot; no FireWire 800 slots<br></li>\n\n<li>Built-in 10/100/1000BASE-T (Gigabit); built-in 54 Mbps AirPort Extreme (802.11g); built-in Bluetooth 2.0+EDR<br></li>\n\n<li>15.4-inch TFT widescree