(44, 44, 'simple', 'NULL', 24, 'Black', 0, 'NULL', 'NULL', 'NULL', '200.00', 'NULL', 'NULL', 'NULL', '2007-08-28 18:06:05', 'NULL', 'NULL', '', 'The Canon EOS Digital Rebel camera now has a new, faster, even smaller big brother. Sibling rivalries aside, the 8.0-megapixel Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class. Even with its advancements in ergonomic design and technology, this easy-to-use EOS digital camera is compatible with all of Canon''s EF lenses, including the EF-S lenses.', '5 x 3.7 x 2.5 inches', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 0, 'NULL', 'NULL', 0, '/c/a/canon-digital-rebel-xt-8mp-digital-slr-camera-1.jpg', 'NULL', '<ul>\n\n<ul class="disc"> \n\n\n\n<li>8.0-megapixel CMOS sensor captures enough detail for photo-quality 16 x 22-inch prints<br></li>\n\n<li>Includes Canon''s EF-S 18-55mm, f3.5-5.6 zoom lens<br></li>\n\n<li>DIGIC II Image Processor provides fast, accurate image processing; captures images at a rate of up to 3 frames per second<br></li>\n\n<li>Fast start-up time--.2 seconds<br></li>\n\n<li>Powered by rechargeable Lithium-ion battery (included, with charger)</li>\n\n</ul>\n\n', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '90', '8', 'NULL', 'Canon Digital Rebel XT 8MP Digital SLR Camera with EF-S 18-55mm f3.5-5.6 Lens (Black)', 'canon, slr, camera, 8, digital', 'Canon Digital Rebel XT 8MP Digital SLR Camera with EF-S 18-55mm f3.5-5.6 Lens (Black)', '449.00', 'Rebel XT ', 'NULL', 'NULL', 'NULL', 'Canon Digital Rebel XT 8MP Digital SLR Camera', 'NULL', 'NULL', 'NULL', '550', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', ' Canon EOS Digital Rebel XT SLR adds resolution, speed, extra creative control, and enhanced comfort in the hand to one of the smallest and lightest digital cameras in its class. ', 'Rebel XT', 'NULL', '/c/a/canon-digital-rebel-xt-8mp-digital-slr-camera-1.jpg', 'NULL', 'NULL', 'NULL', 'NULL', '2', '/c/a/canon-digital-rebel-xt-8mp-digital-slr-camera-1.jpg', 'NULL', '2008-06-25 03:50:46', 'canon-digital-rebel-xt-8mp-digital-slr-camera-with-ef-s-18-55mm-f3-5-5-6-lens-black', 'canon-digital-rebel-xt-8mp-digital-slr-camera-with-ef-s-18-55mm-f3-5-5-6-lens-black.html', 4, '4.00', 'NULL');
