(45, 44, 'simple', 'NULL', 23, 'Silver', 0, 'NULL', 'NULL', 'NULL', '20.00', 'NULL', 'NULL', 'NULL', '2007-08-28 18:18:56', 'NULL', 'NULL', '', 'The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet.\n\n\n\nThe Argus QC-2185 features a clear and bright 1.1-inch CSTN (color super-twist nematic) LCD display that makes it easy to frame the perfect picture. Thanks to its USB 1.1 connection compatibility, this digital camera lets you quickly download pictures to your Mac or PC, and can also function as a handy web camera. The QC-2185 includes eight megabytes of internal SDRAM memory, with the ability to expand camera memory via a built-in SD (secure digital) storage card slot for easy storage and transfer of your pictures. This unit also includes a built-in auto flash with a three to seven foot range, and comes with ArcSoft PhotoImpression''s photo editing software which makes it easy for you to edit, crop, adjust and improve all your best pictures to make them even better.\n\n', '2.75 inches x 1.5 inches', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 0, 'NULL', 'NULL', 0, '/a/r/argus-qc-2185-quick-click-5mp-digital-camera-2.jpg', 'NULL', '<ul>\n\n<ul class="disc".  \n\n<li>5 megapixel digital camera with a 1600 x 1200 resolution and an f2.8 aperture</li>\n\n<li> Clear and bright 1.1-inch CSTN LCD display makes it easy to frame the perfect picture</li>\n\n<li>USB 1.1 connection compatibility lets you quickly download pictures to your Mac or PC, and function as a web camera</li>\n\n<li>Runs on 3 AAA batteries, and requires; Windows OS 98 or higher, at least 32 MB of RAM and 125 MB of hard disk space, and an available USB port</li>\n\n<li>Weighs 3.4 ounces, measures 3.6 x 2.4 x 1.1 inches (W x H x D), and is backed by a 1-year manufacturer''s warranty</li>\n\n</ul>\n\n', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '93', '5', 'NULL', 'Argus QC-2185 Quick Click 2MP Digital Camera', 'Argus, QC-2185, digital, camera, 2MP', 'Argus QC-2185 Quick Click 2MP Digital Camera', '37.49', 'QC-2185', 'NULL', 'NULL', 'NULL', ' Argus QC-2185 Quick Click 5MP Digital Camera', 'NULL', 'NULL', 'NULL', '37.49', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'The Argus QC-2185 Quick Click 5MP digital camera offers all the basic features you need in a compact and stylish digital camera. This unit is easy to use, and is perfect for those who want a completely portable option for taking good pictures, without having to empty their wallet.', 'QC-2185', 'NULL', '/a/r/argus-qc-2185-quick-click-5mp-digital-camera-2.jpg', 'NULL', 'NULL', 'NULL', 'NULL', '2', '/a/r/argus-qc-2185-quick-click-5mp-digital-camera-2.jpg', 'NULL', '2008-08-08 19:52:48', 'argus-qc-2185-quick-click-5mp-digital-camera', 'argus-qc-2185-quick-click-5mp-digital-camera.html', 4, '1.00', 'NULL'),
(46, 44, 'simple', 'NULL', 23, 'Silver', 0, 'NULL', 'NULL', 'NULL', '29.99', 'NULL', 'NULL', 'NULL', '2007-08-28 18:23:34', 'NULL', 'NULL', '', 'Olympus continues to innovate with the launch of the Stylus 750 digital camera, a technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom that tucks away into a streamlined metal, all-weather body design. The camera is distinguished by a number of premium features, including:\n\n\n\n    * An advanced combination of the mechanical CCD-shift Image Stabilization and Digital Image Stabilization work together to ensure the clearest pictures possible in any situation;\n\n    * A 5x optical zoom lens with a newly developed lens element to maintain a small compact size;\n\n    * A 2.5-inch LCD and Bright Capture Technology dramatically improve composition, capture and review of images in low-light situations;\n\n    * Olympus'' exclusive TruePic Turbo Image Processing engine is coupled with a 7.1-megapixel image sensor to produce crisp, high-quality p', '3.8 x 2.1 x 1 inches', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 0, 'NULL', 'NULL', 0, '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', 'NULL', '<ul>\n\n<ul class="disc">\n\n\n\n<li>7.1-megapixel CCD captures enough detail for photo-quality 15 x 20-inch prints<br></li>\n\n<li>5x image-stabilized optical zoom; 2.5-inch LCD display<br></li>\n\n<li>Compact, all-weather body measures 3.8 x 2.1 x 0.96 inches<br></li>\n\n<li>Bright Capture technology; 27 selectable shooting modes; built-in Help guide<br></li>\n\n<li>Stores images on xD Picture Cards; powered by Li-Ion battery (battery and charger included)</li>\n\n</ul>', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '91', '7', 'NULL', 'Olympus Stylus 750 7.1MP Digital Camera with Digital Image Stabilized 5x Optical Zoom and CCD Shift Stabilization (Silver)', 'Olympus, stylus, 750, 7MP, digital, camera, zoom', 'Olympus Stylus 750 7.1MP Digital Camera with Digital Image Stabilized 5x Optical Zoom and CCD Shift Stabilization (Silver)', '161.94', '750', 'NULL', 'NULL', 'NULL', ' Olympus Stylus 750 7.1MP Digital Camera', 'NULL', 'NULL', 'NULL', '161.94', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'A technically sophisticated point-and-shoot camera offering a number of pioneering technologies such as Dual Image Stabilization, Bright Capture Technology, and TruePic Turbo, as well as a powerful 5x optical zoom.', '750', 'NULL', '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', 'NULL', 'NULL', 'NULL', 'NULL', '2', '/o/l/olympus-stylus-750-7-1mp-digital-camera-2.jpg', 'NULL', '2008-08-08 19:57:57', 'olympus-stylus-750-7-1mp-digital-camera', 'olympus-stylus-750-7-1mp-digital-camera.html', 4, '2.00', 'NULL'),
(47, 44, 'simple', 'NULL', 23, 'Silver', 0, 'NULL', 'NULL', 'NULL', '29.99', 'NULL', 'NULL', 'NULL', '2007-08-28 18:27:14', 'NULL', 'NULL', '', 'Replacing the highly popular PowerShot A620, the PowerShot A630 features a rotating 2.5-inch vari-angle LCD, 4x optical zoom lens, and a vast array of creative shooting modes.<br>\n\n\n\nThe PowerShot A630 packs a vast array of advanced features into a remarkably compact space<br><br>\n\n\n\n', '4.3 x 2.6 x 1.9 inches ', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 0, 'NULL', 'NULL', 0, '/c/a/canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom-2.jpg', 'NULL', '<ul>\n\n<ul class="disc">\n\n<li>8-megapixel CCD captures enough detail for photo-quality 16 x 22-inch prints<br></li>\n\n<li>4x optical zoom; 2.5-inch vari-angle LCD display<br></li>\n\n<li>ISO range up to ISO 800 for less blur in low light while hand-holding<br></li>\n\n<li>3:2 guide masks LCD to display 4 x 6-inch print size; 16:9 format option for still images<br></li>\n\n<li>Stores images on SD cards; powered by 4 AA-size batteries</li>\n\n</ul>', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '90', '8', 'NULL', 'Canon PowerShot A630 8MP Digital Camera with 4x Optical Zoom', 'canon, powershot, A630, digital, camera, optical, zoom', 'Canon PowerShot A630 8MP Digital Camera with 4x Optical Zoom', '329.99', 'A630 ', 'NULL', 'NULL', 'NULL', 'Canon PowerShot A630 8MP Digital Camera with 4x Optical Zoom', 'NULL', 'NULL', 'NULL', '329.99', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'Replacing the highly popular PowerShot A620, the PowerShot A630 features a rotating 2.5-inch vari-angle LCD, 4x optical zoom lens, and a vast array of creative shooting modes.', 'A630', 'NULL', '/c/a/canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom-2.jpg', 'NULL', 'NULL', 'NULL', 'NULL', '2', '/c/a/canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom-2.jpg', 'NULL', '2008-08-08 19:58:14', 'canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom', 'canon-powershot-a630-8mp-digital-camera-with-4x-optical-zoom.html', 4, '3.00', 'NULL'),
