(138, 9, 'simple', 'NULL', 24, 'Black', 0, 'NULL', 'NULL', 'NULL', '0.00', 'NULL', 'NULL', 'NULL', '2008-07-25 05:52:03', 'NULL', 'NULL', '', 'This superb, multi-functional Aspire X-Cruiser mid tower case is designed to follow Intel''s recommendations to achieve the highest level of thermal performance. This gorgeous case outperforms most of the expensive chassis in the market, boasts an abundance of innovative features, yet carries a very affordable price tag. The Aspire X-Cruiser is fully loaded with everything you could possibly imagine that a great gaming case could have. With a built-in air duct on the side panel to funnel cool air towards the CPU, the fan-less X-Cruiser is specially designed to bring out the best performance in systems based on high-end processors.', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 0, 'NULL', 'NULL', 0, '/a/p/apevia-black-x-cruiser-case-atx-mid-tower-case-default.jpg', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '', '', '', '0.00', 'NULL', 'NULL', 'NULL', 'NULL', 'Apevia Black X-Cruiser Case ATX Mid-Tower Case (Default)', 'NULL', 'NULL', 'NULL', '150', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'This magnificent new case features 2 x 80mm built-in fans with space for 2 optional fans. The Aspire X-Cruiser features front temperature gauge, front fan speed controller and gauge, and front volume controller and gauge. It also features USB2.0, Firewire and audio ports. The superior cooling solution that X-Cruiser delivers can only be found in very few of the expensive chassis in the market.', 'apevia-black', 'NULL', '/a/p/apevia-black-x-cruiser-case-atx-mid-tower-case-default.jpg', 'NULL', 'NULL', 'NULL', 'NULL', '1', '/a/p/apevia-black-x-cruiser-case-atx-mid-tower-case-default.jpg', 'NULL', '2008-08-08 18:36:29', 'apevia-black-x-cruiser-case-atx-mid-tower-case', 'apevia-black-x-cruiser-case-atx-mid-tower-case.html', 4, '10.00', 'NULL');
