(139, 9, 'simple', 'NULL', 23, 'Silver', 0, 'NULL', 'NULL', 'NULL', '0.00', 'NULL', 'NULL', 'NULL', '2008-07-25 05:54:41', 'NULL', 'NULL', '', 'Introducing the next advancement in case design and technology, the Lexa. Designed from ground up to be symmetrical, the Lexa is representative of the modern lifestyle design cues of today. The Lexa''s minimalist and classy design fits perfectly under the NZXT Classic Series line.', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 0, 'NULL', 'NULL', 0, '/n/z/nzxt-lexa-silver-aluminum-atx-mid-tower-case-default.jpg', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '', '', '', '0.00', 'NULL', 'NULL', 'NULL', 'NULL', 'NZXT Lexa Silver Aluminum ATX Mid-Tower Case (Default)', 'NULL', 'NULL', 'NULL', '199.99', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', '0', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'NULL', 'The Lexa boasts a ridgid, but light weight aluminum chassis. The Lexa''s high-air-flow design, while quiet, ensures cooling options for the more ambitious computing enthusiasts. Three thermal probes provide temperature readings to the illuminated LCD display for monitoring your systems core components. The Lexa ships with a rugged carrying strap with protective window cover for easy single-handed transportation.', 'nzxtlexa', 'NULL', '/n/z/nzxt-lexa-silver-aluminum-atx-mid-tower-case-default.jpg', 'NULL', 'NULL', 'NULL', 'NULL', '1', '/n/z/nzxt-lexa-silver-aluminum-atx-mid-tower-case-default.jpg', 'NULL', '2008-07-25 05:54:41', 'nzxt-lexa-silver-aluminum-atx-mid-tower-case', 'nzxt-lexa-silver-aluminum-atx-mid-tower-case.html', 4, '10.00', 'NULL'),
